import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './Series.css';

const Series = () => {
  const [seriesList, setSeriesList] = useState([]);
  const [selectedSeries, setSelectedSeries] = useState(null);
  const [matches, setMatches] = useState([]);
  const [pointsTable, setPointsTable] = useState([]);
  const [loading, setLoading] = useState(false);
  const [activeTab, setActiveTab] = useState('fixtures');

  useEffect(() => {
    const fetchSeries = async () => {
      try {
        const res = await fetch('/api/series');
        const json = await res.json();
        setSeriesList(json.data || []);
      } catch (err) {
        console.error('Failed to load series list', err);
      }
    };
    fetchSeries();
  }, []);

  const loadSeriesDetails = async (seriesId) => {
    setSelectedSeries(seriesId);
    setActiveTab('fixtures');
    setLoading(true);
    try {
      const res = await fetch(`/api/series/${seriesId}/matches`);
      const json = await res.json();
      setMatches(json.data?.matchList || []);

      const pointsRes = await fetch(`/api/series/${seriesId}/points`);
      const pointsJson = await pointsRes.json();
      setPointsTable(pointsJson.data || []);
    } catch (err) {
      console.error('Failed to load series data', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="series-container">
      <h2>{selectedSeries ? 'Series Details' : 'All Series'}</h2>

      {!selectedSeries ? (
        <div className="series-grid">
          {seriesList.map((s) => (
            <div key={s.id} className="series-card" onClick={() => loadSeriesDetails(s.id)}>
              <h3>{s.name}</h3>
              <p>{s.startDate} - {s.endDate}</p>
            </div>
          ))}
        </div>
      ) : (
        <>
          <button onClick={() => {
            setSelectedSeries(null);
            setMatches([]);
            setPointsTable([]);
          }}>‚Üê Back to Series</button>

          <div className="tabs">
            <button onClick={() => setActiveTab('fixtures')} className={activeTab === 'fixtures' ? 'active' : ''}>Fixtures</button>
            <button onClick={() => setActiveTab('points')} className={activeTab === 'points' ? 'active' : ''}>Points Table</button>
          </div>

          <div className="tab-content">
            {loading ? (
              <p>Loading data...</p>
            ) : activeTab === 'fixtures' ? (
              matches.length > 0 ? (
                <div className="fixtures-list">
                  {matches.map(match => (
                    <Link key={match.id} to={`/match/${match.id}`}>
                      <div className="fixture-card">
                        <strong>{match.name}</strong>
                        <p>{match.date}</p>
                        <p>{match.status}</p>
                      </div>
                    </Link>
                  ))}
                </div>
              ) : (
                <p>No fixtures found.</p>
              )
            ) : (
              pointsTable.length > 0 ? (
                <div className="points-table">
                  <table>
                    <thead>
                      <tr>
                        <th>Team</th>
                        <th>Matches</th>
                        <th>Wins</th>
                        <th>Losses</th>
                        <th>Ties</th>
                        <th>NR</th>
                      </tr>
                    </thead>
                    <tbody>
                      {pointsTable.map(team => (
                        <tr key={team.shortname}>
                          <td>
                            <img src={team.img} alt={team.shortname} width={20} height={20} style={{ marginRight: 8 }} />
                            {team.teamname}
                          </td>
                          <td>{team.matches}</td>
                          <td>{team.wins}</td>
                          <td>{team.loss}</td>
                          <td>{team.ties}</td>
                          <td>{team.nr}</td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              ) : (
                <p>No points table available.</p>
              )
            )}
          </div>
        </>
      )}
    </div>
  );
};

export default Series;
